import React from 'react';
import { useLocation } from 'react-router-dom';

function SubscriptionForm() {
    const location = useLocation();
    const { courseId } = location.state || {};

    const handleSubmit = (e) => {
        e.preventDefault();
        // Здесь логика для оформления подписки
        alert(`Подписка оформлена для курса с ID: ${courseId}`);
    };

    return (
        <div className="form-container">
            <h1>Оформить подписку</h1>
            <form onSubmit={handleSubmit}>
                <p>Вы собираетесь оформить подписку на курс с ID: {courseId}</p>
                <button type="submit" className="form-submit-button">Оформить подписку</button>
            </form>
        </div>
    );
}

export default SubscriptionForm;
